const DEFAULT_TYPE = "text";

export interface InputFieldProps {
    label: string;
    id: string;
    type?: string;
}

const InputField = ({
    label,
    id,
    type = DEFAULT_TYPE
}: InputFieldProps) => {

    return (
    <>
        <label htmlFor={id}>{label}</label>
        <input type={type} id={id} />    
    </>
    )
}

export default InputField;
